<?php

namespace Thirty98\Seeder\States\Arkansas;

use Thirty98\API\Stdlib\AbstractDatabaseSeeder;
use Thirty98\Models\City;
use Thirty98\Models\ARTaxRate;
use Carbon\Carbon;
use Thirty98\Models\County;

class CityTaxRatesSeeder extends AbstractDatabaseSeeder
{
    public $state_code = 'AR';
    protected $table_name = 'ar_tax_rates';

    protected function executeSeeder()
    {
        // County index map.
        $cities = County::join('cities', 'cities.county_id', '=', 'counties.id')
            ->where('state_code', $this->state_code)
            ->get();

        $citiesIndexes = [];

        foreach ($cities as $city) {
            $citiesIndexes[$city['slug']] = trim($city['id']);
        }

        foreach ($this->getCities() AS $city) {
            $city_slug = $this->slugit(trim($city['name']));
            $county_rate = trim($city['county_rate']);
            $city_rate = trim($city['city_rate']);
            $state_rate = trim($city['state_rate']);

            $cityID = $citiesIndexes[$city_slug];

            $exists = ARTaxRate::where('city_id', $cityID)
                ->where('start_date', $city['start_date'])
                ->where('end_date', $city['end_date'])
                ->first();

            if (!$exists) {
                $insert_arr = [
                    'city_id' => $cityID,
                    'county_rate' => $county_rate,
                    'city_rate' => $city_rate,
                    'state_rate' => $state_rate,
                    'start_date' => $city['start_date'],
                    'end_date' => $city['end_date']
                ];

                $result = ARTaxRate::insertGetId($insert_arr);

                if (!is_numeric($result)) {
                    die('City Inserted Failed for: ' . json_encode($insert_arr));
                }
            }

            continue;
        }
    }

